import React, { useEffect, useState } from "react";
import axios from "axios";

import { createColumnHelper, flexRender, getCoreRowModel, useReactTable } from "@tanstack/react-table";
import { TableContainer, TableHead } from "@mui/material";



function MyTableComponent(){

    const [values, setValues] = useState([]);


    const columnHelper = createColumnHelper();

    const column = [
        columnHelper.accessor('id',{
            columnHelper : "Customer Id"
        }),
        columnHelper.accessor('name', {
            header : "Name"
        }),
        columnHelper.accessor('email',{
            header : "Email"
        }),
        columnHelper.accessor('phone',{
            header : "mobile no"
        }),
        columnHelper.accessor('Refrence',{
            header : "Reference"
        }),
        columnHelper.accessor('current_address',{
            header : "current_address"
        }),
        columnHelper.accessor('permanent_address',{
            header : "permanent_address"
        }),
        columnHelper.accessor('create_at',{
            header : "create_at"
        }),
        columnHelper.accessor('update_at',{
            header : "update_at"
        })
    ]

    useEffect(()=>{
        const getData = async () =>{
            try {
                const res = await axios.get("http://localhost:8000/api/v1/admin/getCustomer")
                console.log("response data", res.data);
                setValues(res.data)
            } catch (error) {
                console.log('error genrated', error);
            }
        }
        getData();
    },[])
    

    const table = useReactTable({
        data : values,
        columns: column,
        getCoreRowModel : getCoreRowModel(),
    })


    return(
        <>
                <TableContainer component={Paper}>
                    <Table>
                        <TableHead>
                            {
                                table.getHeaderGroups().map(headerGroups =>{
                                    
                                })
                            }
                        </TableHead>
                    </Table>
                </TableContainer>
        </>
    )
}
export default MyTableComponent;
